import QuoteForm from '../components/quotes/QuoteForm'; //importing the QuoteForm 

const NewQuote = (props) => {

    const addQuoteHandler = (quoteData) => { // defining the handler function for handling
        // the data incoming from QuoteForm component 
        console.log(quoteData);// console logging the incoming data from QuoteForm 
    };

    return(
        <QuoteForm onAddQuote={addQuoteHandler}/>
    );
};

export default NewQuote;
